import React, {Component} from "react";
import Button from "@mui/material/Button";
import Modal from "@mui/material/Modal";
import Box from "@mui/material/Box";
import ReactJson from "react-json-view";
import Grid from "@mui/material/Grid";
import { styled } from '@mui/material/styles'
import DeleteObject from "./DeleteObject";
import {modalStyle} from "./util";
import "./ViewObject.css"


class ViewObject extends Component {
    constructor(props) {
        super(props)
        this.state = {
            objectKind: this.props.objectKind,
            objectName: this.props.objectName,
            objectOriginalJSON: this.props.objectOriginalJSON,

            modalOpen: false,
        };
    }

    handleModalOpen = () => {
        this.setState({modalOpen: true})
    }
    handleModalClose = () => {
        this.setState({modalOpen: false})
    }

    render() {
        const {objectName, objectKind, objectOriginalJSON} = this.state
        const {handleSendRequest} = this.props
        return (
            <div className='Modal-ViewObject'>
                <Button variant="outlined" onClick={this.handleModalOpen} size="small">
                    Setting
                </Button>

                <Modal
                    open={this.state.modalOpen}
                    onClose={this.handleModalClose}
                    aria-labelledby="modal-modal-title"
                    aria-describedby="modal-modal-description"
                >
                    <Box sx={modalStyle}>
                        {/*<Grid container spacing={2} className='Setting'>*/}
                        {/*    <Grid item xs={12}>*/}
                        {/*        <h2>Configuration of {objectName} [{objectKind}]</h2>*/}
                        {/*    </Grid>*/}
                        {/*    <Grid item xs={8}>*/}
                        {/*        <ReactJson src={objectOriginalJSON}/>*/}
                        {/*    </Grid>*/}
                        {/*    <Grid item xs={4}>*/}
                        {/*        <DeleteObject*/}
                        {/*            objectKind={objectKind}*/}
                        {/*            objectName={objectName}*/}
                        {/*            handleSendRequest={handleSendRequest}*/}
                        {/*        />*/}
                        {/*    </Grid>*/}
                        {/*</Grid>*/}

                        <Grid container spacing={2} className='Setting'>
                            <Grid container spacing={2} className='Title'>
                                <Grid item xs={12}>
                                    <h2>Configuration of {objectName} [{objectKind}]</h2>
                                </Grid>
                            </Grid>

                            <Grid container className='Main' xs={12} md={7} lg={8} spacing={4}>
                                <Grid xs={6} lg={3}>
                                    111
                                </Grid>
                                <Grid xs={6} lg={3}>
                                    222
                                </Grid>
                                <Grid xs={6} lg={3}>
                                    333
                                </Grid>
                                <Grid xs={6} lg={3}>
                                    444
                                </Grid>
                            </Grid>
                            <Grid
                                xs={12}
                                container
                                justifyContent="space-between"
                                alignItems="center"
                                flexDirection={{ xs: 'column', sm: 'row' }}
                                sx={{ fontSize: '12px' }}
                            >
                                <Grid sx={{ order: { xs: 2, sm: 1 } }}>
                                    555
                                </Grid>
                                <Grid container columnSpacing={1} sx={{ order: { xs: 1, sm: 2 } }}>
                                    <Grid>
                                        666
                                    </Grid>
                                    <Grid>
                                        777
                                    </Grid>
                                    <Grid>
                                        888
                                    </Grid>
                                </Grid>
                            </Grid>
                        </Grid>

                </Box>
                </Modal>
            </div>
        )
    }
}

export default ViewObject
